                <div className="cta-content">
                    <h2>Ready to Start Your IT Career?</h2>
                    <p>Contact our admissions team to learn more about our programs, tuition assistance options, and how we can help you achieve your career goals.</p>
                    <a href="#contact" className="btn btn-primary">Contact Us Today</a>
                </div>
            </div>
        </section>
    );
};

export default CTASection;
